import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";

const SearchResult = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div style={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center'
        }}>
            <h1 style={{ fontSize: '32px', margin: '20px 0' }}>{data.searchname}</h1>
            <img
                src={data.thumbnail}
                alt={data.searchname}
                style={{ width: '50%', marginBottom: '20px' }}
            />
            <p style={{ fontSize: '18px', textAlign: 'center', maxWidth: '600px' }}>{data.abstract}</p>
            <h2 style={{ fontSize: '24px', margin: '20px 0' }}>Books:</h2>
            <ul style={{ listStyle: 'none', paddingLeft: 0 }}>
                {data.book.map((book) => (
                    <li key={book} style={{ fontSize: '18px', marginBottom: '10px' }}>{book}</li>
                ))}
            </ul>
        </div>
    );
};

export default SearchResult;
